import React from "react";
import "../Styling/TopBar"; // Move up one level to access the `Styling` folder
import "../Styling/MetricCard";
import "../Styling/DashboardOverview.css"; // Correct path to CSS file


function DashboardOverview() {
  return (
    <div className="dashboard-overview">
      <TopBar />
      <div className="main-grid">
        <MetricCard title="Average Latency" value="Average Latency Across Africa: 50ms" />
        <MetricCard title="Download Speed" value="Download Speed: 25 Mbps (Average)" />
        <MetricCard title="Upload Speed" value="Upload Speed: 10 Mbps (Average)" />
        <MetricCard title="Packet Loss" value="Packet Loss: 0.5%" />
        <MetricCard title="Top 3 ISPs" value="ISP 1, ISP 2, ISP 3" />
        <MetricCard title="Highest Latency ISP" value="ISP 4: 100ms" />
      </div>
    </div>
  );
}

export default DashboardOverview;
